import React from "react";
import {useState, useEffect} from 'react';

function Timer() {
    const [count, setCount] = useState(0);
    
    useEffect(() => {
        setTimeout(() => {
            setCount((count) => count + 1)
        }, 1000);   
    });
        

    while (count<60)return(
        <h2>I have rendered {count} times!</h2>
    )
}

export default Timer;
